import React from 'react'

import { TransactionContainer, HeaderContainer } from './transaction.styles';

const Transaction = () => {

    return (
        <TransactionContainer>
			<HeaderContainer>Transfer History</HeaderContainer>
			<TableContainer>
				<TypeContainer>USD deposit</TypeContainer>
				<DateContainer>USD deposit</DateContainer>
			</TableContainer>
        </TransactionContainer>
)}


export default Transaction;
